import React from 'react'

function CompA(props) {
    const data=props.data;
    return (
        <div className='section-a'>
            {data.map(chair=>(<div className='chair'>
                     <h6>{chair.number}</h6> 
                    </div>))}
        </div>
    )
}

export default CompA
